import React from 'react';
import Link from 'next/link';
import PropTypes from 'prop-types';
import { Menu, Row, Col } from 'antd';


const AppLayout = ({children}) => {
    return(
        <div>
            <Row gutter={8}>
                <Col xs={24} md={6}>
                    <Menu>
                        <Menu.Item>
                            <Link href="/">
                                <a>홈</a>
                            </Link>
                        </Menu.Item>
                        <Menu.Item>
                            <Link href="/profile">
                                <a>프로필</a>
                            </Link>
                        </Menu.Item>
                        <Menu.Item>
                            <Link href="/signup">
                                <a>회원가입</a>
                            </Link>
                        </Menu.Item>
                    </Menu>
                </Col>
                <Col xs={24} md={12}>
                    {children}
                </Col>
                <Col xs={24} md={6}>
                </Col>
            </Row>
        </div>
    );
};

AppLayout.propTypes = {
    children: PropTypes.node.isRequired,
};

export default AppLayout;
